import gql from "graphql-tag"

const GET_INVESTOR_BY_ID = gql`
  query investor ($id: String!) {
    investor (id: $id) {
      id
      name
      description
      slug
      email
      website
      image
      address {
        text
      }
      phone
      mobile
    }
  }
`;
// description, name, cover, address, phone, email, mobile, mobile, image,
export {
  GET_INVESTOR_BY_ID,
}
